Quem é Samira?

Samiira significa "a rainha dos desertos" em árabe. Ela é uma rainha que apareceu na história quando Deus ordenou a Abraão que se dirigisse ao país dos caldeirões, situado no Oriente Médio. Samira era uma jovem que estava grávida e, após seu nascimento, foi abandonada pelos seus pais. Samira foi criada pelo pastor Abraão e sua serva Hagar.

A lista de características, valores e sentimentos que representam o nome SAMIRA é:

- O nome é um dos mais populares no Brasil;

